index.addDoc({"lunr_id":544,"link":"{{ site.baseurl }}/ar/about.html","title":"حول المشروع","content":" يشرف قسم التاريخ بكلية الاداب جامعة الخرطوم على أرشيف الصور التاريخي السوداني كجزء من مكتبة فوتوغرافيا أوسع تسعى إلى توفير صور عن التاريخ السوداني كأداة تعليمية ومورد للطلاب السودانيين والباحثين. تحتوي هذه المكتبة على صور وكتب تعرض جميع فترات التاريخ السوداني. يجمع الارشيف الصور الاصلية من تاريخ السودان ويحافظ عليها خصوصاً الصور القديمة التي أخذت في العصر الثنائي وفي بداية الاستقلال. بالرغم من ان الارشيف يحافظ على (نيقاتيف) الصور الفوتوغرافية فالصور نفسها يتم مسحها وتخزينها رقمياً بغرض تسهيل فحصها والعثور عليها لأي شخص. يفتح الارشيف أبوابه لكل الطلاب والباحثين والعلماء ممن يهتمون بتاريخ المجتمع السوداني. من أجل إقامة هذه الأرشيف فاننا نطلب تبرعات بالصور و(النيقاتيف) لتخزينها رقميا وأرشفتها. سيتم مسح الصور ضوئياً وتعاد الصور الاصلية لأصحابها.أما (النيقاتيف) الفوتوغرافية سيتم تنظيفها وتخزينها في أكمام (النيقاتيف) في بيئة مسيطر على مناخها وسيتم ترميمها عندما يكون ذلك ممكنا. كل تبرعات الصور سيتم تحويلها رقمياً ونسخها بجودة عالية وسيتم إعاداتها لأصحابها . على ذاكرة بيانات (فلاش) مع الصور الأصلية ذاتهأ. حقوق نشر الصور تبقى محفوظة للمانح ويسمح للارشيف بتخزينها وعرض أجزاء محددة منها على الموقع الالكتروني. "}); 
index.addDoc({"lunr_id":545,"link":"{{ site.baseurl }}/en/about.html","title":"About","content":" The Sudan Historical Photography Archive is overseen by the History Department of Khartoum University as part of its broader historical photography library which seeks to provide a library of images on Sudanese history as a pedagogical tool and resource to Sudanese students and researchers. This library includes images and books that display all parts of Sudanese history. The archive collects and preserves original photography from Sudan’s past, particularly old photographs taken by Sudanese photographers during the periods of the Condominium and early independence. While the archive is equipped to preserve negatives, the images themselves are scanned and stored digitally, so that they can be examined and searched easily by anyone consulting them. It is open to all students, researchers, and scholars interested in the history of Sudanese society. To create this archive, we are seeking donations of photographs and negatives to be stored digitally in the archive. Photographs will be scanned and stored digitally, then returned to their owners. Photographic negatives will be cleaned and stored in negative sleeves in a climate controlled environment and will be restored whenever possible. All images donated to the archive will be digitized, with high quality digital copies returned to donors on a flash drive along with the physical photographs. Copyright of the images will remain with the donor; however, the archive will have permission to store the images and display selected photographs on its website. "}); 
index.addDoc({"lunr_id":546,"link":"{{ site.baseurl }}/ar/donate.html","title":"تبرع بالصور","content":" على المهتمين بالتبرع بالصور للارشيف الاتصال بنا على البريد الالكتروني sudanphoto@uofk.edu ‬ أو على رقم الواتساب ‏‪+249904696503 ‬. سنقوم بالرد سريعا لترتيب وقت مناسب للقاء ومناقشة تفاصيل التبرع بالصور. في الاجتماع الاول سنناقش إجراءات التبرع بالصور وسنسأل أسئلة لنعرف الصور التي يريد المانح أن يتبرع بها ويتضمن ذلك أسئلة عن الفترة الزمنية لالتقاط الصور وموضوعاتها. في ذلك الاجتماع سنرد على أي أسئلة إضافية من المانح وسنناقش كيفية المضى قدماً. بعد اختيار المانح للصور التي يريد التبرع بها سنجتمع معه ونوقع اتفاقا قانونيا يشمل الأذونات للصور التي أعطاها المانح بغرض تخزين الصور في الأرشيف الرقمي. سيحدد الاتفاق أيضاً الصور المسموح بعرضها في الموقع كجزء من المعرض الالكتروني. سنفحص الصور مع المانح ونجمع معلومات عن كل صورة بما في ذلك تاريخ الصورة ومن هو المصور ومحتويات الصورة بالإضافة إلى أي معلومة اخرى مهمة لفهم الصورة. بعد اختيار كل الصور سنحولها إلى مركز المسح الرقمي في قسم التاريخ بجامعة الخرطوم حيث سنقوم بمسحها وتخزينها رقمياً في الارشيف. سنقوم في الوقت ذاته بتسجيل معلومات عن الصور وصنع إدخالات لكاتالوجات الصور. بعد انتهاء المسح سنعيد الصور للمانح مع “ذاكرة بيانات” (فلاش) تحتوي على نسخة رقمية من كل الصور التي مسحناها رقمياً. ندعو أيضا للتبرع (بنيقاتيف) الصور الفوتوغرافية. إجراءات التبرع (بالنيقاتيف) شبيهة بإجراءات الصور. سنبدأ بالاجتماع مع المانح ومناقشة كل الاجراءات وبعد ذلك سنفحص الصور وتاريخها وما هي الصور المسموح بعرضها في الموقع وما هي المسموح بها للارشيف فقط. سنتوصل الى اتفاق حول (النيقاتيف) وهل سيتم التبرع بها للأرشيف وهل ستبقي في الجامعة أم سيتم مسحها رقمياً فقط وسنوقع اتفاقا قانونيا. بعد ذلك سنحولها لمركز المسح الرقمي حيث سنقوم بتنظيفها وترميمها عندما يكون ذلك ممكنا وسنقوم بمسحها رقمياً للحفظ في الأرشيف. سنقوم في اخر الامر بحفظ (النيقاتيف) في الأرشيف أو سنعيدها للمانح حسب الاتفاق وسنعطي المانح “ذاكرة بيانات” (فلاش) يحتوي نسخ من كل الصور. "}); 
index.addDoc({"lunr_id":547,"link":"{{ site.baseurl }}/en/donate.html","title":"Donate Photos","content":" Those interested in donating images to the archive should contact us either via email at or via Whatsapp at +249904696503. We will respond promptly and set up an appointment to meet and discuss the photographs to be donated. On our first meeting, we will discuss the process of donating photographs and will ask questions to learn about the photographs to be donated, including what time period they come from and the nature of the images that they display. At that meeting, we will answer any additional questions the donors have and discuss the logistics of moving forward. After the donor has selected which photographs to donate, we will sit down and sign a legal agreement outlining the permissions the donor has given for photographs to be stored in the digital archive and will designate which photographs can also be displayed on the archive’s website as part of a digital exhibition. We will go through all the images with the donor, gathering information as available on each image including the year it was taken, who the photographer was, who is present in the photograph, and any other details important to understanding the photograph. After going through the photographs, we will take them to the digitization center at the History Department at Khartoum University, where we will scan them all and store them digitally in the archive, logging the information we recorded on each photograph to create the catalog entries for the images. After finishing, we will return the photographs to the donor along with a flash drive containing digital copies of all the photographs we scanned. We request as well donation of photographic negatives. The process for donating photographic negatives is similar; we will begin by meeting with the donor and discussing the process, then going through the negatives, their history, and which photographs can be displayed on the website and which just in the archive. We will then reach an understanding on whether negatives themselves will be donated to the archive or whether their availability for digitization is being donated, and we will sign a legal agreement specifying to this. After, we will bring them to the digitization center, where we will clean and restore them whenever possible, then scanning them for storage in the archive. After that, we will either store the negatives or return them to the donor as agreed upon in advance, and we will provide the donor with a flash drive containing digital copies of all images donated. "}); 
index.addDoc({"lunr_id":548,"link":"{{ site.baseurl }}/ar/history-of-phototography.html","title":"تاريخ الفوتوغرافيا السودانية","content":" ظهرت الفوتوغرافيا في السودان للمرة الأولى في نهايات عام 1890 حينما أخضع الجيشان المصري والبريطاني المهدية ووثق الجنود البريطانيون معاركهم في السودان لأجل نشرها في بريطانيا. في وقتها كانت هذه التكنولوجيا محدودة الإمكانيات وضعيفة جدا مستخدمة كاميرات كبيرة الحجم وفلم زجاجي. نتيجة لذلك كانت الصور الفوتوغرافية تؤخذ بعد المعارك أو الأحداث بدلا من اللحظة ذاتها. صارت الكاميرات تستخدم أكثر في السودان في فترة الحكم الثنائي, عندما قام المسؤولون الاستعماريون في مكتب وزارة الإعلام بتصوير النشاط العسكري ومشاريع التنمية. بدا تجار أقباط ويونانيون وأرمن بجلب كاميرات إلى السودان من أجل التجارة بين 1920 و 1940 وكانوا يعملون فى بادئ الأمر في المناسبات وفي الاستوديوهات في الخرطوم ثم بعد ذلك امتد عملهم إلى بقية أنحاء البلاد. بدأ المصورون السودانيون يعملون في الفوتوغرافيا في اواخر عام 1940 واشتروا أجهزتهم من هؤلاء التجار والمسافرين. في هذا الوقت اعتمدت الحكومة الثنائية في اعمالها على المصورين الاقباط, فركز المصورون السودانيون على مشاريعهم الخاصة. بدأ بعضهم في تأسيس استوديوهات صغيرة للتصوير الفوتوغرافي حيث صوروا الأسر وصور الشخصية لأغراض خاصة وللوثائق الرسمية. هذه الاستوديوهات والصور التي انتجتها بالإضافة الى فوتوغرافيا من المسؤولين الاستعماريين أنفسهم تقوم بوظيفة مصدر معلومات حيوي عن المجتمع السوداني في عصر الاستعمار. بحلول زمن الاستقلال انتشرت استوديوهات الفوتوغرافيا بصورة أكبر وكان هنالك استوديو واحد على الأقل في أغلبية المدن الكبيرة في السودان حيث كانت الأسر توثق الأحداث الكبيرة عن الحياة من ضمنها الأعراس والولادات وزيارات الأقارب الذين يسكونون بعيدا. كما كانت الأحداث المهمة توثق من قبل المصورين مثل نشاط الأندية الرياضية والجمعيات. تمنح هذه الصور إضاءات مهمة ليس فقط في طبيعة المناسبات الرسمية بل أيضا في طبيعة المجتمع السوداني سريعة التغير, من خلال توثيق الأسر والجمعيات لمظاهر الحياة الاجتماعية السودانية. "}); 
index.addDoc({"lunr_id":549,"link":"{{ site.baseurl }}/en/history-of-phototography.html","title":"Photography in Sudan","content":" Photography came to Sudan initially in the late 1890s, as the British and Egyptian militaries conquered the Mahdiya, with British soldiers documenting their conquests in Sudan for the purpose of distributing information back home. At the same time, this technology was extremely limited and fragile, using large format cameras and glass film. As a result, photographs were largely taken after battles or events rather than in the moment. Cameras began being used more frequently in Sudan during the Condominium period, with colonial officials in the Public Relations Office photographing military activity and development projects. Coptic, Greek, and Armenian traders began bringing cameras to Sudan for commercial purposes in the 1920s and 30s, when they would work for hire at private events and at studios, first in Khartoum and later across the country. Sudanese photographers began to work in photography in the late 1940s, buying their equipment from these travelers and traders. At the time, the Condominium government relied on Coptic photographers for their work, so these Sudanese photographers focused on private events. Some of them began setting up small photography studios, where they photographed families as well as taking personal portraits that could used both for personal usage as well as for official documents. These studios and the photographs they produced, as well as the photography of colonial officials themselves, serve as a vital source of information on Sudanese society during the colonial period. By the time of independence, photography studios had become more widespread, with most larger cities in Sudan hosting at least one studio, where families would go to document large life events, including weddings, births, and visits from relatives who lived far away. Major events were documented by photographers, including the activities of sports clubs and associations. In the process, these photographs give insight not only into the nature of official events, but also the rapidly changing nature of Sudanese society, as families and associations documented what Sudanese social life looked like. "}); 
index.addDoc({"lunr_id":550,"link":"{{ site.baseurl }}/ar/involved.html","title":"شارك","content":" على الطلاب والمصورين المهتمين بالمشاركة في أرشيف الصور التاريخية السودانية الاتصال بنا على عنوان البريد الالكتروني ‏‪sudanphoto@uofk.edu ‬ أو على رقم الواتساب ‏‪+249904696503‬. نحتاج إلى الطلاب والباحثين المتدربين على الإجراءات الإرشيفية وأولئك الذين لديهم تجربة ارشيفية سابقة والذين يهتمون باكتساب تجربة في هذا المجال, نحثهم على الاتصال بنا للمشاركة والتطوع للأرشيف. سنقوم بترتيب ورش عمل للمتطوعين في الشهور القادمة. سيتدرب المتطوعون في هذه الورش على اجراءات وأخلاقيات البحث بالإضافة إلى ممارسات المسح الرقمي وتسجيل البيانات. ندعو المصورين المهتمين بالتطوع في الأرشيف للاتصال بنا. نحتاج بصورة خاصة الى المصورين ذوي التجربة في تنظيف واستعادة (نيقاتيف) الصور الفوتوغرافية. سيقوم المشاركون بالتحاق بدورات تدريبية مع المتطوعين الأخرين بالإضافة إلى المشاركة في عملية ترميم (النيقاتيف). "}); 
index.addDoc({"lunr_id":551,"link":"{{ site.baseurl }}/en/involved.html","title":"Get Involved","content":" Students and photographers interested in getting involved with the historical photography archive should contact us at or via Whatsapp at +249904696503. We have a need for students and researchers trained in archival practices. Those with previous experience or interested in acquiring such experience are encouraged to contact us to get involved in volunteering for the archive. We will be arranging workshops for volunteers in the coming months, in which volunteers will learn the procedures for ethical research, as well as the practices for digitization and recording data. Photographers interested in volunteering with the archive are also strongly encouraged to contact us. We are particularly in need of photographers with experience cleaning and restoring negatives. In addition to participating the the trainings with other volunteers, photographers will be able to help in the restoration process for negatives. "}); 
index.addDoc({"lunr_id":552,"link":"{{ site.baseurl }}/ar/photos.html","title":"الصور","content":" الصور المعروضة في الموقع هي جزء من المجموعة الموجودة بأرشيف قسم التاريخ بكلية الأداب بجامعة الخرطوم، وقد تم اختيار هذه الصور لتعبر عن مختلف الاحداث التاريخية ،حيث تتضمن في البدء صور عن بدايات جامعة الخرطوم في فترة ما بعد الاستقلال ثم نشاطات بعض الطرق الصوفية وبعض ابرز الشخصيات السياسية والفنانين والرياضيين بالاضافة لعدد من الصور عن حياة السودانيين اليومية في الفترة 1950-1960 لتعكس مدي تطور وتنوع .الحياة في المجتمع السوداني في بدايات استقلال السودان ## Online Images: {{ on_website.size }} ## Metadata only: {{ meta_only.size }} "}); 
index.addDoc({"lunr_id":553,"link":"{{ site.baseurl }}/en/photos.html","title":"Photographs","content":" The photographs below all come from archive collections that can be viewed in full in the offices of Khartoum University’s History Department, Faculty of Arts. They have been selected because they show different aspects of Sudanese history, including the beginnings of Khartoum University, activities of Sufi orders, prominent politicians, musicians, athletes, and daily life from the 1950s and 60s. In the process, they illustrate the diversity of Sudanese life in the period of early independence. ## Metadata only: {{ meta_only.size }} "}); 
index.addDoc({"lunr_id":554,"link":"{{ site.baseurl }}/ar/team.html","title":"فريق العمل","content":" أرشيف الصور التاريخية السودانية مشروع خاص بقسم التاريخ بكلية الأداب جامعة الخرطوم، يدار هذا المشروع بواسطة فريق عمل متكامل يتضمن :- * د/ أ امل سليمان بادي رئيس قسم التاريخ * بروفسور فدوي عبد الرحمن علي طه * أ/ ربيكا قيلد هذا بالاضافة الي اعضاء قسم التاريخ في مختلف التخصصات علي وجهه الخصوص * بروفسور ابراهيم الزين صغيرون * د/ أ عمر عبد الله حميدة * أ/ سلافة احمد محمد * أ/ زهرة جبريل كما يشمل فريق العمل ايضا مجموعة من الزملاء بالمحتوي الرقمي بالجامعة وهم * المهندس ياسر حسن الامين * أ/ مشاعر حسن بكري * المهندس معاوية محمد شريف هذا بالاضافة الى انه كانت هناك بعض التصاميم والاستشارات الفنية والدعم من مكتبات جامعة كولمبيا في ولاية المتحدة ومجموعتها في طرق تجريبية في العلوم الإنسانية الرقمية على وجهه الخصوص ماري نيروب وجونثان ريف واليكس قيل. "}); 
index.addDoc({"lunr_id":555,"link":"{{ site.baseurl }}/en/team.html","title":"Project Team","content":" Sudan Historical Photography Archive is overseen by the History Department, Faculty of Arts at Khartoum University. It is managed and coordinated by a team including: * Dr. Amel Suliman, Department Chair * Professor Fadwa Taha * Rebecca Glade Others in the department have worked on different aspects of the project, particularly: * Professor Ibrahim Saghirun * Dr. Omer Abdullah Hummeida * Sulafa Ahmed Mohamed * Zahra Gebreel The website is managed and run by the Technology Department of Khartoum, overseen and maintained by: * Eng. Yassir Hassan Elamin * Maowia Muhammad Sharif * Mashaer Hassan Bakri It was designed with consultation and support from Columbia University Libraries and the Experimental Methods in Digital Humanities Group, particularly from Marii Nyrop, Jonathan Reeve, and Alex Gil. "}); 
